import React from "react";
import Logo from "../Logo/Logo";
import "./header.css";

const Header = () => {
  return (
    <div className="header-wrapper">
      <div className="container"></div>
      <div className="header">
        <Logo />
      </div>
    </div>
  );
};

export default Header;
